import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {
  return (
    <div className="App">
      <div className="lenovoBackground">
        <img className="lenovoLogo" src='/svg/lenovoLogo.svg' width='4%' float="left"/>
        <div className="lenovoWhite">
          <h2>Yoga S740 (14)</h2>
          <h3>Wyróżniająca inteligencja</h3>
        <p>Z komputerem Yoga S740 możesz pracować i korzystać z rozrywki w eleganckim stylu. Ten imponujący laptop w całkowicie metalowej obudowie działa z pełną mocą procesora Intel® Core™ 10. generacji i oferuje inteligentne, przydatne na co dzień funkcje. Lekki, ale wydajny, zapewnia wysokiej klasy funkcje rozrywkowe dzięki baterii wystarczającej na nawet 15 godzin, efektownemu wyświetlaczowi 4K VESA400 HDR oraz fantastycznemu dźwiękowi z technologią Dolby Atmos®.
</p>
        </div>
        <img src='/png/lenovo1.png'/>
      </div>
      <img src='/png/lenovo2.png' className="picCenter"/>
      <div className="lenovoBlack">
      <h3>Pomysłowe technologie dla wszystkich</h3>
      <p>Lenovo poszerza zakres możliwości w nowych laptopach Yoga opracowanych wspólnie z firmą Intel® i wyposażonych w funkcje sztucznej inteligencji. Teraz możesz mówić do urządzenia i nim sterować z drugiego końca pokoju. Oglądać wideo o podwyższonej jakości w programie Windows Media Player. Unikać zmęczenia oczu dzięki wyświetlaczowi, który automatycznie zmniejsza natężenie światła niebieskiego odpowiednio do pory dnia. A to jeszcze nie wszystko.
      </p>
      <h3>Sztuczna inteligencja i zdrowy rozsądek</h3>
      <p>Zaawansowany procesor Intel® Core™ 10. generacji do urządzeń mobilnych i utraprzenośny laptop Yoga S740 dostosowują się do Twoich potrzeb i stylu użytkowania. Razem tworzą rozwiązanie bardziej intuicyjne i osobiste, którego sztuczna inteligencja dynamicznie reaguje na Twoje działania i optymalizuje żywotność baterii.
</p>
<img src='/png/promo1.png' className="picCenter"/>
      </div>
    </div>
  );
}

export default App;
